%   Number retrieved from Mathematica with the program
% daub[n_] := Module[
%    {},
%    a = WaveletFilterCoefficients[DaubechiesWavelet[n], 
%       WorkingPrecision -> 3*n + 36][[All, 2]];
%    aa = StringJoin["case ", ToString[n], "; a=["];
